import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";

const Set=()=>{
  
  let M=new Date().toLocaleTimeString();
 
 

  const state = useState();
  let [Any,what] = useState(M);
  
const Inn=() => {
  M=new Date().toLocaleTimeString();
  what(M);
};
   
  return (
  <>
      <h1>{Any}</h1>
      <button onClick={Inn}>tap on</button>
  </>
  );





 }




ReactDOM.render(
   <>
   <Set />
   </>
 
  ,document.getElementById("root"));
